@j_v_66 @Viral_B_Shah @minigamedev @BatesDmbates People are using #RStats because #python looks hacky Or because they have dependency of some R package...

This will change as we move forward...

You just can't rely on ecosystems forever...

@Viral_B_Shah @minigamedev @BatesDmbates @j_v_66 He also said that #RStats core team is not allowing him to restrict the syntax or bring a JVM to speed up the things else it's possible to speed up R

That said I too love #JuliaLang.Thanks for such a wonderful language

Only problem is if R and #python somehow gets a speed gain

@j_v_66 @Viral_B_Shah @minigamedev @BatesDmbates I saw your video on scala based jvm increasing speed of R...Great content

If #RStats had been a faster language #python would never have appeared in the scene. The sooner R core realizes this the better for the language and community in general

Speed Half of #julialAng would do

@Viral_B_Shah @minigamedev @BatesDmbates @j_v_66 #RStats is also moving into same direction by updating GC with ARC in 4.0 and bringing altrep in 3.5 and I hope sooner we could see a type system in R programming too...

I think you should watch this video in detail... He is a colleague of @j_v_66 

